import{_ as n,r as o,o as s,c as d,a as e,b as r,d as i,e as a}from"./app.5470f5f8.js";const h={},c=a('<h1 id="模组兼容问题" tabindex="-1"><a class="header-anchor" href="#模组兼容问题" aria-hidden="true">#</a> 模组兼容问题</h1><h2 id="advanced-rocketry" tabindex="-1"><a class="header-anchor" href="#advanced-rocketry" aria-hidden="true">#</a> Advanced Rocketry</h2><p>将 <em><strong>overworldSkyOverride</strong></em> 设置为 <strong>false</strong>。</p><h2 id="astral-sorcery" tabindex="-1"><a class="header-anchor" href="#astral-sorcery" aria-hidden="true">#</a> Astral Sorcery</h2><ul><li><p>1.12.2及更早版本</p><p>在 <em><strong>weakSkyRenders</strong></em> 中添加 <strong>0</strong>。它应该看起来像这样： <code>S:weakSkyRenders &lt; 0 &gt;</code></p></li><li><p>1.15.x</p><p>在 <em><strong>weakSkyRenders</strong></em> 中添加 <strong>0</strong>。它应该看起来像这样： <code>weakSkyRenders = [ 0 ]</code></p></li><li><p>1.16.x</p></li></ul><p>在 <em><strong>skyRenderingConstellations</strong></em> 中添加 <strong>&quot;minecraft:overworld&quot;</strong>。它应该看起来像这样： <code>skyRenderingConstellations = [ &quot;minecraft:overworld&quot; ]</code></p><h2 id="better-end" tabindex="-1"><a class="header-anchor" href="#better-end" aria-hidden="true">#</a> Better End</h2><p>如果它导致你使用的光影包出现问题，请在 **<em>config/betterend/client.json</em>**中把 <code>customSky [default: true]</code>设置为 <strong>false</strong>。</p><h2 id="better-foliage-1-12" tabindex="-1"><a class="header-anchor" href="#better-foliage-1-12" aria-hidden="true">#</a> Better Foliage（1.12）</h2><p>不一定会崩溃，但在某些光影包中会导致树叶断裂。要解决这个问题，你需要去确定主界面的 <em>Mods -&gt; Better Foliage -&gt; Shader Configuration</em> 是否与你的光影包的 <em><strong>block.properties</strong></em> 文件中的指定值相匹配。 注意：_<strong>block.properties</strong>_可以包含多个MC版本的ID，所以一定要为你的MC版本使用正确的ID。如果你不确定要使用什么ID，请询问光影包的创作者。</p><h2 id="betweenlands" tabindex="-1"><a class="header-anchor" href="#betweenlands" aria-hidden="true">#</a> Betweenlands</h2><p>将 <em><strong>use_shader</strong></em> 设置为 <strong>false</strong>。注意：这将解决一些渲染问题，但维度本身可能没有你的光影包的工作效果。</p><h2 id="botania" tabindex="-1"><a class="header-anchor" href="#botania" aria-hidden="true">#</a> Botania</h2><p>将_<strong>fancySkybox.enable</strong>_ 和 <em><strong>shaders.enabled</strong></em> 设置为 <strong>false</strong>。</p><h2 id="cofh核心-1-15以上" tabindex="-1"><a class="header-anchor" href="#cofh核心-1-15以上" aria-hidden="true">#</a> COFH核心（1.15以上）</h2><p>将 <em><strong>Render Area Effect Block Breaking</strong></em> 设置为 <strong>false</strong>。</p><h2 id="computer-craft-tweaked" tabindex="-1"><a class="header-anchor" href="#computer-craft-tweaked" aria-hidden="true">#</a> Computer Craft Tweaked</h2><p>将 <em><strong>monitor_renderer</strong></em> 设置为 &quot;gui.computercraft:config.peripheral.monitor_renderer.vbo&quot;。</p><h2 id="extended-days" tabindex="-1"><a class="header-anchor" href="#extended-days" aria-hidden="true">#</a> Extended Days</h2><p>将 <strong><em>覆盖天空渲染</em></strong> 设置为 <strong>false</strong>。</p><h2 id="litematica" tabindex="-1"><a class="header-anchor" href="#litematica" aria-hidden="true">#</a> Litematica</h2><p>将 <em><strong>Visuals -&gt; enableRendering</strong></em> 设置为 <strong>false</strong>。</p><h2 id="psi" tabindex="-1"><a class="header-anchor" href="#psi" aria-hidden="true">#</a> Psi</h2><ul><li><p>1.12</p><p>将 <strong><em>B: &quot;Use Shaders &quot;</em></strong> 设置为 <strong>false</strong>。</p></li><li><p>1.15+</p><p>将 <strong><em>useShaders</em></strong> 设置为 <strong>false</strong>。</p></li></ul><h2 id="rats" tabindex="-1"><a class="header-anchor" href="#rats" aria-hidden="true">#</a> Rats</h2><p>在 <em><strong>视频设置 -&gt; 性能</strong></em> 中关闭 <em><strong>快速渲染</strong></em>。</p><h2 id="snowrealmagic" tabindex="-1"><a class="header-anchor" href="#snowrealmagic" aria-hidden="true">#</a> SnowRealMagic</h2><p>在 <em><strong>视频设置 -&gt; 光影</strong></em> 中打开 <em><strong>传统照明</strong></em>。</p><h2 id="the-midnight-mod" tabindex="-1"><a class="header-anchor" href="#the-midnight-mod" aria-hidden="true">#</a> The Midnight Mod</h2><p>将 <strong><em>rift_shaders</em></strong> 设置为 <strong>false</strong>。注意：这将解决一些渲染问题，但维度本身可能没有你的光影包的工作效果。</p><h2 id="thermal-dynamics" tabindex="-1"><a class="header-anchor" href="#thermal-dynamics" aria-hidden="true">#</a> Thermal Dynamics</h2>',31),g={href:"https://www.curseforge.com/minecraft/mc-mods/unifine",target:"_blank",rel:"noopener noreferrer"},l=a('<h2 id="最后" tabindex="-1"><a class="header-anchor" href="#最后" aria-hidden="true">#</a> 最后</h2><p>如果你已经排除了上述所有的 Mod，那么找出问题 Mod 的下一步就是进行<strong>二分法搜索</strong>。</p><ul><li>将你的 <em>Mods</em> 分成 <em><strong>2</strong></em> 组</li><li>测试这两组，并<strong>保留仍有问题的那一组</strong></li><li><strong>重复</strong>，直到只剩下一个 Mod（和它的前置 Mod ）</li><li><strong>反馈给管理组</strong>，以便于我们将它添加进这里</li></ul>',3);function m(p,f){const t=o("ExternalLinkIcon");return s(),d("div",null,[c,e("p",null,[r("在你的游戏中添加 Unifine："),e("a",g,[r("https://www.curseforge.com/minecraft/mc-mods/unifine"),i(t)])]),l])}const b=n(h,[["render",m],["__file","mods.html.vue"]]);export{b as default};
